    [],nt"num_tags": 3,nt"name": "narrative-report-montezuma-national-wildlife-refuge-january-april-1953",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Montezuma National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1953.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, fur harvest and timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes Refuge visitors and Refuge participation. Items of interest, photographs,
    and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
